import React, { useState } from 'react';
import { User } from '../services/auth';
import APITest from './APITest';
import HealthcareSearch from './HealthcareSearch';
import './Dashboard.css';

interface DashboardProps {
  user: User;
  onLogout: () => void;
}

const Dashboard: React.FC<DashboardProps> = ({ user, onLogout }) => {
  const [activeTab, setActiveTab] = useState<'dashboard' | 'search' | 'api-test'>('dashboard');

  const renderContent = () => {
    switch (activeTab) {
      case 'api-test':
        return <APITest />;
      case 'dashboard':
      default:
        return (
          <div className="dashboard-content">
            <div className="quick-actions">
              <h3>How can we help you today?</h3>
              <div className="action-grid">
                <button className="action-card">
                  <span className="action-icon">🏥</span>
                  <div>
                    <h4>Find Urgent Care</h4>
                    <p>Locate nearby urgent care facilities</p>
                  </div>
                </button>

                <button className="action-card">
                  <span className="action-icon">🩺</span>
                  <div>
                    <h4>Symptom Checker</h4>
                    <p>Get healthcare recommendations</p>
                  </div>
                </button>

                <button className="action-card">
                  <span className="action-icon">💊</span>
                  <div>
                    <h4>Find Pharmacy</h4>
                    <p>Locate pharmacies for prescriptions</p>
                  </div>
                </button>

                <button className="action-card">
                  <span className="action-icon">🗺️</span>
                  <div>
                    <h4>Travel Health</h4>
                    <p>Plan healthcare for your trip</p>
                  </div>
                </button>
              </div>
            </div>

            <div className="status-section">
              <h3>System Status</h3>
              <div className="status-items">
                <div className="status-item">
                  <span className="status-indicator success"></span>
                  <span>Google Authentication: Connected</span>
                </div>
                <div className="status-item">
                  <span className="status-indicator pending"></span>
                  <span>Location Services: Pending Setup</span>
                </div>
                <div className="status-item">
                  <span className="status-indicator pending"></span>
                  <span>Healthcare API: Pending Integration</span>
                </div>
              </div>
            </div>
          </div>
        );
    }
  };

  return (
    <div className="dashboard">
      <div className="user-header">
        <div className="user-info">
          <img 
            src={user.picture} 
            alt={user.name}
            className="user-avatar"
          />
          <div>
            <h2>Welcome, {user.name}!</h2>
            <p>{user.email}</p>
          </div>
        </div>
        <div className="header-actions">
          <button 
            className={`tab-btn ${activeTab === 'dashboard' ? 'active' : ''}`}
            onClick={() => setActiveTab('dashboard')}
          >
            Dashboard
          </button>
          <button 
            className={`tab-btn ${activeTab === 'api-test' ? 'active' : ''}`}
            onClick={() => setActiveTab('api-test')}
          >
            API Test
          </button>
          <button className="logout-btn" onClick={onLogout}>
            Sign Out
          </button>
        </div>
      </div>

      {renderContent()}
    </div>
  );
};

export default Dashboard;
